@thelifeofchaceelijah takes this picture every year with his @samsungmobileusa phone. To give his son Chace Elijah confidence and to let him know he's no different than any other normal child. This picture also is to show Chace's growth and thrives in life, because he was born with a congenital heart defect called (technology of fallot) and he had to have a feeding tube please and stomach because he wasn't eating orally and was vastly underweight.
⠀⠀⠀
Robert makes sure he let his son know that as long as he's Breathing he'll (Never Be In a Fight Alone) and together chace will always have a support team because Dad isn't walking in front or behind him, but together side by side step by step every inch of Chace's Journey.
⠀⠀⠀
